import React from 'react';
import {IoLogoInstagram, IoLogoLinkedin, IoLogoTwitter} from 'react-icons/io';
import {FaInstagram } from 'react-icons/fa';

const SocialNetwork = () => {




    return (
        <div className="social-network">
            <ul className="social-list">
                <a href="https://www.instagram.com/don_key.shot_devfront/" target='blank' rel="noopener noreferrer">
                    <li><IoLogoInstagram size={25}/></li>
                </a>
                <a href="https://www.linkedin.com/in/nicolas-klipfel-7871a21b3/" target='blank' rel="noopener noreferrer">
                    <li><IoLogoLinkedin size={25}/></li>
                </a>
                <a href="https://twitter.com/DCodeshot" target='blank' rel="noopener noreferrer">
                    <li><IoLogoTwitter size={25}/></li>
                </a>
            </ul>            
        </div>
    );
};

export default SocialNetwork;
